import React from 'react'
import './styles/homepage.css'
import $ from 'jquery'

class homepage extends React.Component {
    componentDidMount() {
        $("#page-wrap").wrapInner("<table cellspacing='30'><tr>");
        $(".post").wrap("<td></td>");
        $("body").mousewheel(function(event, delta) {
        this.scrollLeft -= delta * 30;
        event.preventDefault();})

    }
    
     render() {
        return(
            <div className="page-wrap" style={{width:`${window.screen.availWidth}px`, height:`${window.screen.availHeight}px`}}>
                <div className="post homepage_container" style={{width:`${window.screen.availWidth}px`, height:`${window.screen.availHeight}px`}}>
                    
                </div>
                <div className="post Catalogue_container" style={{width:`${window.screen.availWidth}px`, height:`${window.screen.availHeight}px`}}>

                </div>

                
            </div>
            
        )
    }
}

export default homepage;
